import React from 'react';
import Card from './Card';

const Cardlist = ({robots}) => {
    const cardArray = robots.map((i) => {

        return ( <Card 
        key={i} 
        id={robots[i].id} 
        name={robots[i].name} 
        email={robots[i].email}
        /> //key is good practice
        );
    })

    return(
        <div> 
            {cardArray}        
        </div>
    );
}
export default Cardlist;
